import React from 'react';

const EquipmentCard = ({ equipment, onDelete }) => {
    return (
        <div className="equipment-card">
            <h3>{equipment.name}</h3>
            <p><strong>Description:</strong> {equipment.description}</p>
            <p><strong>Availability:</strong> {equipment.availability_start} - {equipment.availability_end}</p>
            <p><strong>Price:</strong> ${equipment.price}</p>
            <p><strong>Condition:</strong> {equipment.condition}</p>
            <p><strong>Manufacturer:</strong> {equipment.manufacturer}</p>
            <p><strong>Last Service:</strong> {new Date(equipment.last_service).toLocaleDateString()}</p>
            <button onClick={() => onDelete(equipment.id)}>Delete</button>
        </div>
    );
};

export default EquipmentCard;
